import { React, useState } from 'react';

export default function HookTest() {
    const [count, setCount] = useState(0);
    const handelIncrement = () => {
        setCount(count + 1)
    }

    return (
    <>
        <button onClick={handelIncrement}>
            Increment
        </button>
        <span>{count}</span>
    </>
    )
}
